import React from 'react';
import Notes from './Notes.js';
import Compare from './Compare.js'; // Check the import path for Compare component

const Home = (props) => {
    const { showAlter } = props;

    // Define a function to handle the comparison result
    const handleComparison = (result) => {
        // Handle the comparison result here, e.g., display it or perform some action
        console.log('Comparison Result:', result);
    };

    return (
        <div>
            <Notes showAlter={showAlter} />
            <h1>This Home Page</h1>
            <Compare onCompare={handleComparison} /> {/* Ensure Compare is correctly imported */}
        </div>
    );
}

export default Home;
